import React from 'react';

const Certifications = () => {
    return (
        <section id="certifications">
            <h2>Certifications</h2>
            <ul>
                <li><a href="https://google.accredible.com/2ec289f0-84ab-45ea-a221-22cab14c759c#acc.5H81ZEuW" target="_blank" rel="noopener noreferrer">Google Cloud Associate, Google, 2024</a></li>
            </ul>
        </section>
    );
};

export default Certifications;
